import React from 'react'
import {Link, link} from 'lucide-react';
const Product_mgmt_system = () => {
  return (
    <div className="bg-white shadow-lg shadow-white-500/50 rounded-sm mt-3 ml-3 text-black text-center flex">
    <span className='flex mt-3 ml-3'><Link className='mr-3 -mt-3' size={15}/>Product Management System</span>
    </div>
  )
}

export default Product_mgmt_system
